import React from 'react';
import HandDetection from './components/HandDetection';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Sol-fa Hand Symbol Detection</h1>
      </header>
      <main>
        <HandDetection />
      </main>
      <footer>
        <p>Position your hand clearly in front of the camera and make Kodaly hand symbols</p>
      </footer>
    </div>
  );
}

export default App;
